import React, {memo} from 'react';
import styled from 'styled-components';

import mq from '../style/MediaQuery';

const HeaderContainer = styled.div`
    width:100%;
    height:120px;
    background-color: #fff;
    margin: 0 auto;

    .headerWrap{
        max-width: 1200px;
        height: 100%;
        margin:0 auto;
        display: flex;
        justify-content: space-between;
        align-items: center;
        background-color: #ff0;

        .navWrap{
            display: flex;
        }
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div className='headerWrap'>
        <div className='logoWrap'>
            <a href='#'><img src='' alt='내일응원로고' /></a>
        </div>
        <ul className='navWrap'>
            <li className='navItem'>
                <a href='#'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#'>취업지원</a>
            </li>
            <div className='subNavWrap'></div>
        </ul>
      </div>
    </HeaderContainer>
  );
});

export default Header;
